import self from '../../../images/self.jpg';

function AboutMe() {
    return (
        <aboutMe className='section section__for_about'>
            <h2 className='section__title'>Студент</h2>
            <div className='about__info'>
                <h3 className='about__name'>Анастасия</h3>
                <p className='about__about'>Фронтенд-разработчик, 22 года</p>
                <p>Я родилась и живу в Ханты-Мансийске, закончила факультет экономики ЮГУ. Я люблю слушать музыку, смотреть фильмы, а ещё увлекаюсь спортом. Недавно начала кодить. Frontend привлекает меня тем, что результат проделанной работы виден сразу и здесь огромный простор для творчества.</p>
                <a href='https://github.com/Anastasiy-alt' target='blank' className='about__link'>Github</a>
            </div>
            <img src={self} alt='Фото.' className='about__photo' />
        </aboutMe>
    )
};

export default AboutMe;
